const TaskList = ({ data, title }) => {
    return (
        <div className="task-list">
            <h2>{ title }</h2>
            {data.map(task => (
                <div className="task" key={ task.id }>
                    <Task title={ task.title } body={ task.body } author={ task.author } />
                </div>
            ))}
        </div>
    );
}
 
export default TaskList;
